IF NOT EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'[dbo].[bu]') AND type in (N'P', N'PC'))
BEGIN
EXEC dbo.sp_executesql @statement = N'
create procedure [dbo].[bu]
as
BEGIN

	DECLARE @bufile VARCHAR(512)
	DECLARE @sql VARCHAR(512)

	select @bufile = ''symphony_''+replace(convert(varchar, getdate(), 102), ''.'', '''')+ ''_'' + replace(convert(varchar, getdate(),108),'':'','''')  + ''.bak''

	select @sql = ''BACKUP DATABASE [Symphony] TO  DISK = N''''''
	select @sql = @sql + ''D:\Dev\Symphony\Database\staging\'' + @bufile + '''''' '' 
	select @sql = @sql + ''WITH NOFORMAT, NOINIT,  NAME = N''''Symphony-Full Database Backup'''', SKIP, NOREWIND, NOUNLOAD,  STATS = 10''

	-- BACKUP DATABASE [Symphony] TO  DISK = N''D:\Dev\Symphony\Database\sym_backup.bak'' WITH NOFORMAT, NOINIT,  NAME = N''Symphony-Full Database Backup'', SKIP, NOREWIND, NOUNLOAD,  STATS = 10
	EXEC (@sql)
	-- print @sql
	


END

' 
END
