/****** Object:  View [dbo].[vProgramGroup]    Script Date: 02/04/2010 21:48:28 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
IF NOT EXISTS (SELECT * FROM sys.views WHERE object_id = OBJECT_ID(N'[dbo].[vProgramGroup]'))
EXEC dbo.sp_executesql @statement = N'create view [dbo].[vProgramGroup]
as
select ''Loc:'' + location_cd Caption, 1 reccount
from location
union all
select ''Div:'' + division_cd, 2
from division
union all
select ''BU:'' + business_unit_cd, 3
from business_unit
union all
select ''Dept:'' + department_cd, 4
from department
union all
select distinct ''Cat:'' + category1, 5
from person
where category1 is not null
'
GO
